  constructor() {
    super();
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleSubmit(event) {
    event.preventDefault();
    const data = new FormData(event.target);
    fetch("/api/form-submit-url", { method: "POST", body: data });
  }
  render() {
    return (
      <form onSubmit={this.handleSubmit}>
